import React from 'react';


function ParkGallery ({ parks }){

    const empty = parks === 0 ? true : false;

    const cards = parks.map(park => 
      <img 
        alt = {park.images} 
        key = {park.id} 
        src = {park.images[0].url}
        />)

      return <div id='gallery'>
          {empty ? <h1>Loading ...</h1> : cards}
           </div>
}





export default ParkGallery;





